import React from 'react';
import ReactDOM from 'react-dom';
import Home from './Home';
import './index.css';
import Data from './Data'




ReactDOM.render(

   <>

           {Data.map(function dyn(val){
            return (
      <Home
            title={val.title}
            subtitle={val.subtitle}
            imgsrc={val.imgsrc}
           />
   )
           })}
   </>,
  document.getElementById('root')
);
